import React, { Component } from 'react';
import './App.css';
import Movie from './Movie'

const movies = [
  "Matrix",
  "Full Metal Jacket",
  "Old Boys",
  "Star Wars"
]


class App extends Component {
  render() {
    return (
      <div className="App">
        <Movie title={movies[0]}></Movie>
        <Movie title={movies[1]}></Movie>
        <Movie title={movies[2]}></Movie>
        <Movie title={movies[3]}></Movie>
      </div>
    );
  }
}
export default App;
